import React from 'react';
import "../../styles/styles.scss";
import HomeBannerTop from "../../components/Banner/HomeBannerTop";
import HomeSubBannerTop from "../../components/Banner/HomeSubBannerTop";
import HomeCategory from "../../components/Items/Category/HomeCategory";
import Collections from "../../components/Items/Collections";
import HomeRestaurant from "../../components/Items/HomeRestaurant";

class HomePage extends React.Component {
  render() {
    return (
      <div>
        <div className="banner">
          <HomeBannerTop />
          <div className="sub-banner-contain">
            <HomeSubBannerTop />
            <div style={{ height: 10 }} />
            <HomeSubBannerTop />
          </div>
        </div>
        <HomeCategory />
        <Collections />
        <HomeRestaurant />
        <HomeRestaurant />
        <HomeRestaurant />
        <HomeRestaurant />
        <HomeRestaurant />
        <HomeRestaurant />
        <HomeRestaurant />
      </div>
    )
  }
}

export default HomePage;
